What Goes Up (2009) 

Verenigde Staten
Drama
104 minuten

geregisseerd door Jonathan Glatzer
met Steve Coogan, Hilary Duff en Josh Peck

In 1986 is de verstrooide journalist Campbell Babbitt (Steve Coogan) aanwezig bij de lancering van de space shuttle Challenger, om daar een artikel over te schrijven. In de chaos, na de ontploffing van de space shuttle, raakt zijn leven verwikkeld met een aantal probleem jongeren.


